import React from 'react';
import {
    RoadmapSec,
    InfoRow,
    Column1,
    ImgWrapper,
    Img,
  } from './Carousel.elements';

import profile from "../../images/profile.jpg"
import profileCroc from "../../images/profile1.jpg"


function CarouselItem({
    lightBg
  }) {
    return (
        <>
        <RoadmapSec lightBg={lightBg}>

            <InfoRow>

              <Column1>
                <ImgWrapper>
                  <Img src={profile} />
                </ImgWrapper>
              </Column1>

              <Column1>
                <ImgWrapper>
                  <Img src={profileCroc} />
                </ImgWrapper>
              </Column1>

            </InfoRow>

        </RoadmapSec>
      </>
    );
}

export default CarouselItem;
